// PageDetails.js
import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';

const PageDetails = () => {
    const { pageId } = useParams();
    const [pageDetails, setPageDetails] = useState({
        title: "",
        description: "",
        image: "",
        name: "",
        seoDetails: {
            metaTitle: "",
            metaDescription: "",
            keywords: [],
        },
    });

    useEffect(() => {
        // Simulate fetching details for the selected page using pageId
        // Replace this with actual data fetching logic
        const samplePageDetails = {
            title: "Sample Title",
            description: "This is a sample page description.",
            image: "sample-image.jpg",
            name: "John Doe",
            seoDetails: {
                metaTitle: "Sample Meta Title",
                metaDescription: "Sample meta description for SEO.",
                keywords: ["sample", "keywords", "seo"],
            },
        };
        setPageDetails(samplePageDetails);
    }, [pageId]);

    return (
        <div>
            <h2>{pageDetails.title}</h2>
            <p>{pageDetails.description}</p>
            <img src={pageDetails.image} alt={pageDetails.title} />
            <p>Name: {pageDetails.name}</p>

            <div>
                <h3>SEO Details</h3>
                <p>Meta Title: {pageDetails.seoDetails.metaTitle}</p>
                <p>Meta Description: {pageDetails.seoDetails.metaDescription}</p>
                <p>Keywords: {pageDetails.seoDetails.keywords.join(', ')}</p>
            </div>
        </div>
    );
};

export default PageDetails;
